import React, { useState } from "react";

import { db } from "../../firebase"
import { collection, 
         addDoc, 
         updateDoc, 
         serverTimestamp } from "firebase/firestore"

import { UserAuth } from '../../context/AuthContext'

const Analytics = () => {

    const [title, setTitle] = useState("")
    const [body, setBody] = useState("")
    const [conclusion, setConclusion] = useState("")

    const createJournalTitle = (e) => {
        setTitle(() => e.target.value)
    }

    const createJournalBody = (e) => {
        setBody(() => e.target.value)
    }

    const createJournalConclusion = (e) => {
        setConclusion(() => e.target.value)
    }

    return (
        <div>
            What is my worry?
            <input
                onChange={createJournalTitle}
            />
            How likely is it that my worry comes true?
            <input
                onChange={createJournalBody}
            />
            If the worst did happen, what can I do to cope?
            <input
                onChange={createJournalConclusion}
            />
            <p>{title}</p>
            <p>{body}</p>
            <p>{conclusion}</p>
            <button>I'm ready to let go of my negative thoughts!</button>
            <button>I'm not ready to let these thoughts go</button>
        </div>
    )
}

export default Analytics
